-- Table of US Airports from Alaistair Aitchison

CREATE TABLE dbo.US_Airports(
    AirportCode varchar(4) PRIMARY KEY,
	AirportName varchar(255) NULL,
	City varchar(255) NULL,
	County varchar(255) NULL,
	State char(2) NULL,
	Location geography NULL,
	Elevation int NULL
);
GO

