IF EXISTS(SELECT 1 FROM sys.objects WHERE name = 'FindAlternateAirports')
  DROP PROCEDURE dbo.FindNearbyAirports;
GO

CREATE PROCEDURE dbo.FindNearbyAirports
  @AirportCode varchar(4),
  @DistanceInKilometers float
AS BEGIN
  DECLARE @Airport GEOGRAPHY;
  SET @Airport = (SELECT Location FROM dbo.US_Airports WHERE AirportCode = @AirportCode);
  IF @Airport IS NOT NULL BEGIN
    SELECT AirportCode, AirportName, Location.STDistance(@Airport) / 1000 AS Distance
    FROM dbo.US_Airports
    WHERE Location.STDistance(@Airport) <= @DistanceInKilometers * 1000;
  END;
END;
GO
  
SELECT Location FROM dbo.US_Airports;
GO

EXEC dbo.FindNearbyAirports 'SEA',50;
GO

EXEC dbo.FindNearbyAirports 'IAD',50;
GO

